import React from "react";


const Card=( {robot})=>{

	return (
		<div className="tc grow bg-light-purple" >
			<img src={`https://robohash.org/${robot.id}`} alt='robots' />
			<text> {robot.username}	</text>
			<text> {robot.email}	</text>
		</div>
	);
}

export default Card;
